import React from "react";

export default function Music() {
  return (
    <div className="p-6 max-w-3xl mx-auto">
      <h2 className="text-2xl font-semibold mb-4">음악</h2>
      <ul className="list-disc pl-6">
        <li>Band "Oyan" - Single "Wooyadongdong"</li>
        <li>Solo "Nam Heeon" - EP "Psychedelic Disco - A Flowing Life"</li>
        <li>Solo "Nam Heeon" - 1st Ablum "Freedom" in process</li>
        <li>New band planned</li>
        <li>Genre: Disco, Psychedelic, Garage Rock</li>
      </ul>
    </div>
  );
}
